var suggestions=document.getElementById('suggestions'),userinput=document.getElementById('userinput');document.addEventListener('keydown',inputFocus);function inputFocus(a){a.keyCode===191&&(a.preventDefault(),userinput.focus()),a.keyCode===27&&(userinput.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(b){const d=suggestions.querySelectorAll('a'),e=[...d],a=e.indexOf(document.activeElement);let c=0;b.keyCode===38?(b.preventDefault(),c=a>0?a-1:0,d[c].focus()):b.keyCode===40&&(b.preventDefault(),c=a+1<e.length?a+1:a,d[c].focus())}(function(){var b=new FlexSearch({preset:'score',cache:!0,doc:{id:'id',field:['title','description','content'],store:['href','title','description']}}),c=[{id:0,href:"/docs/prologue/introduction/",title:"EEWPBotについて",description:null,content:'\u003ch3 id="eewpbotとは"\u003eEEWPBotとは\u003c/h3\u003e\n\u003cp\u003eEarthquake Early Warning Plus (EEWP) Botは2018年から開発されている、地震速報に特化したDiscord向けのBotです。\u003cbr\u003e\n「すばやく、わかりやすい地震情報を受け取れる」Botを目標に作成しています。\u003cbr\u003e\nまた、3回にも亘るリファクタリングにより処理の最適化や高速化・高性能化が行われています。\u003c/p\u003e\n'},{id:1,href:"/docs/updatelog/3.0.0/",title:"Ver 3.0.0",description:null,content:""},{id:2,href:"/docs/other/eew-notice/",title:"緊急地震速報について",description:null,content:'\u003cp\u003eこのBotは強震モニタ上で配信されている緊急地震速報を受信しています。\u003cbr\u003e\n震源が深すぎる場合や継続報で震源が深くなってしまった場合などは受信できませんのでご注意ください。\u003cbr\u003e\nほかにも緊急地震速報には特性や限界が存在します。\u003c/p\u003e\n\u003cp\u003e詳細は\u003ca href="http://www.data.jma.go.jp/svd/eew/data/nc/shikumi/tokusei.html"\u003e気象庁ホームページ\u003c/a\u003eをご確認ください。\u003c/p\u003e\n'},{id:3,href:"/docs/other/caution/",title:"ご利用の際の注意事項",description:null,content:"\u003cp\u003eこのBotは自宅にあるサーバーにて稼働しています。\u003c/p\u003e\n\u003cp\u003e以下のいずれかの事由があると判断した場合、ユーザーに事前に通知することなく本サービスの全部または一部の提供を停止または中断することができるものとします。\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e本サービスにかかるコンピュータシステムの保守点検または更新を行う場合\u003c/li\u003e\n\u003cli\u003e地震、落雷、火災、停電または天災などの不可抗力により、本サービスの提供が困難となった場合\u003c/li\u003e\n\u003cli\u003eコンピュータまたは通信回線等が事故により停止した場合\u003c/li\u003e\n\u003cli\u003eその他、本サービスの提供が困難と判断した場合\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e本サービスの提供の停止または中断により、ユーザーまたは第三者が被ったいかなる不利益または損害についても、一切の責任を負わないものとします。\u003c/p\u003e\n"},{id:4,href:"/docs/prologue/quick-start/",title:"導入方法",description:null,content:'\u003cp\u003e\u003ca href="https://discord.com/api/oauth2/authorize?client_id=460323119651880960\u0026amp;permissions=26624\u0026amp;scope=bot"\u003eこちらをクリックすることでBotを導入することが出来ます。\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003eBotを導入するとセットアップメッセージが自動的に投稿されますので、それに従って地震情報を受け取るためのチャンネルを設定してください。\u003c/p\u003e\n'},{id:5,href:"/docs/prologue/first-settings/",title:"セットアップ",description:null,content:'\u003col\u003e\n\u003cli\u003e\n\u003cp\u003e地震情報を受け取るためのチャンネルを作成する\u003cbr\u003e\n(既存のチャンネルに設定したいのであればチャンネルの作成は必要ありません。)\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003e地震情報を受け取りたいチャンネルで\u003ccode\u003e/eq register\u003c/code\u003eまたは\u003ccode\u003e/eq reg\u003c/code\u003eと入力します。\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eこれでセットアップは完了です。\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e\u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003e追加で通知を受け取る際の最低震度設定や、Yahoo地震情報の投稿の有無を設定することが出来ます。\u003cbr\u003e詳しくは「使い方」の「チャンネル設定」を参照してください。 \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'},{id:6,href:"/docs/updatelog/2.x.x/",title:"~ Ver 2.x.x",description:null,content:'\u003cp\u003eVersion 3.0.0以前の更新履歴は\u003ca href="https://yukineko.me/eewp#toc7"\u003eこちら\u003c/a\u003eに記載されています\u003c/p\u003e\n'},{id:7,href:"/docs/other/",title:"その他",description:null,content:""},{id:8,href:"/docs/prologue/",title:"はじめに",description:null,content:""},{id:9,href:"/docs/help/",title:"ヘルプ",description:null,content:""},{id:10,href:"/docs/updatelog/",title:"更新履歴",description:null,content:""},{id:11,href:"/docs/",title:"Docs",description:"Docs Doks.",content:""}];b.add(c),userinput.addEventListener('input',e,!0),suggestions.addEventListener('click',f,!0);function e(){var g=this.value,e=b.search(g,5),f=suggestions.childNodes,h=0,i=e.length,c;for(suggestions.classList.remove('d-none'),e.forEach(function(b){c=document.createElement('div'),c.innerHTML='<a href><span></span><span></span></a>',a=c.querySelector('a'),t=c.querySelector('span:first-child'),d=c.querySelector('span:nth-child(2)'),a.href=b.href,t.textContent=b.title,d.textContent=b.description,suggestions.appendChild(c)});f.length>i;)suggestions.removeChild(f[h])}function f(){while(suggestions.lastChild)suggestions.removeChild(suggestions.lastChild);return!1}})()